import React from 'react'
import ReactDom from 'react-dom'

function Greeting(){
  return(
    <>
      <Person/>
      <Message/>
    </>
  );
}

const Person = () => <h2>Pablo</h2>;
const Message = () => <p>This is a paragraph</p>;

ReactDom.render(<Greeting/>, document.getElementById('root'));
